import json

class JSONEncoder(json.JSONEncoder):
    def default(self, obj):
        # hex string on bytes
        if isinstance(obj, (bytes, bytearray)):
            return obj.hex()

        return super().default(obj)

def pprint(obj):
    print(json.dumps(obj, indent=4, cls=JSONEncoder))

